import axios from 'axios';

const axiosClient = axios.create({
    baseURL: 'https://datnxeoffice.azurewebsites.net/api/',
    timeout: 1000,
    headers: {'X-Requested-With': 'XMLHttpRequest'}
});

export default axiosClient;
